import React from 'react';
import './NavBar.scss';

const NavBar = () => {
    return (
        <navbar className='navbar'>
            <div className='container'>
                <div className='navbar__logo'>blog.mercuryo</div>
                <div className='navbar__menu'>
                    <ul>
                        <li>
                            <a href=''>On- and off-ramps</a>
                        </li>
                        <li>Banking-as-a-Service</li>
                        <li>Crypto Pay in & Pay out</li>
                        <li>Fiat Pay in & Pay out</li>
                        <li>Wallet</li>
                    </ul>
                    <div className='navbat__search'></div>
                </div>
            </div>
        </navbar>
    );
};

export default NavBar;
